import React, { Component } from "react";
import { StyleSheet, View, Text } from "react-native";
import { Entypo, Ionicons, Feather } from "@expo/vector-icons";

function PendingOrderShowDetails(props) {
  return (
    <View style={styles.container}>
      <View style={styles.innerContainer}>
        <View style={styles.topRowContainer}>
          <Entypo name="chevron-small-left" style={styles.backIcon}></Entypo>
          <Text style={styles.pendingOrdersLabel}>Pending Orders</Text>
          <Ionicons name="md-close" style={styles.closeIcon}></Ionicons>
        </View>
        <View style={styles.orderDetailsContainer}>
          <View style={styles.orderNameRowStack}>
            <View style={styles.orderNameRow}>
              <Text style={styles.orderNameLabel}>Order Name:</Text>
              <Text style={styles.orderNameValue}>Peter</Text>
            </View>
            <View style={styles.orderNumberRow}>
              <Text style={styles.orderNumberLabel}>Order Number:</Text>
              <Text style={styles.orderNumberValue}>12345</Text>
            </View>
          </View>
          <View style={styles.divider}></View>
          <View style={styles.orderTypeWithDateRow}>
            <Text style={styles.orderType}>In-Store Order</Text>
            <Text style={styles.orderDate}>15/02/24</Text>
          </View>
        </View>
        <View style={styles.cartDetailsContainer}>
          <Text style={styles.cartDetailsOrderLabel}>Order:</Text>
          <Feather name="edit" style={styles.editIcon}></Feather>
          <Text style={styles.cartDetails}>1. Greek</Text>
        </View>
        <View style={styles.bottomBtnRow}>
          <View style={styles.cancelBtn}>
            <Text style={styles.cancelOrder}>Cancel Order</Text>
          </View>
          <View style={styles.completeBtn}>
            <Text style={styles.completeOrder}>Complete Order</Text>
          </View>
        </View>
      </View>
    </View>
  );
}

const styles = StyleSheet.create({
  container: {
    borderRadius: 10,
    justifyContent: "flex-start",
    alignItems: "center",
    width: 540,
    height: 609,
  },
  innerContainer: {
    width: 496,
    height: 490,
    alignItems: "center",
    justifyContent: "space-between",
    marginTop: 20,
  },
  topRowContainer: {
    width: 496,
    height: 80,
  },
  backIcon: {
    color: "rgba(0,0,0,1)",
    fontSize: 50,
  },
  pendingOrdersLabel: {
    fontFamily: "roboto-700",
    color: "#121212",
    fontSize: 20,
    width: 140,
    height: 24,
    marginTop: 33,
    marginLeft: 172,
  },
  closeIcon: {
    color: "rgba(0,0,0,1)",
    fontSize: 40,
    marginTop: -51,
    marginLeft: 473,
  },
  orderDetailsContainer: {
    width: 400,
    height: 105,
  },
  orderNameRow: {
    top: 0,
    left: 0,
    width: 124,
    height: 19,
    position: "absolute",
  },
  orderNameLabel: {
    fontFamily: "roboto-700",
    color: "#121212",
    fontSize: 15,
    marginTop: 1,
  },
  orderNameValue: {
    fontFamily: "roboto-regular",
    color: "#121212",
    fontSize: 15,
    marginTop: -1,
    marginLeft: 89,
  },
  orderNumberRow: {
    top: 17,
    left: 0,
    width: 146,
    height: 19,
    position: "absolute",
  },
  orderNumberLabel: {
    fontFamily: "roboto-700",
    color: "#121212",
    fontSize: 15,
    marginTop: 1,
  },
  orderNumberValue: {
    fontFamily: "roboto-regular",
    color: "#121212",
    fontSize: 15,
    marginTop: -1,
    marginLeft: 104,
  },
  orderNameRowStack: {
    width: 146,
    height: 36,
  },
  divider: {
    width: 399,
    height: 1,
    backgroundColor: "rgba(0,0,0,1)",
    marginTop: 15,
    marginLeft: 1,
  },
  orderTypeWithDateRow: {
    width: 400,
    height: 18,
    marginTop: 19,
  },
  orderType: {
    fontFamily: "roboto-700",
    color: "#0029ff",
    fontSize: 15,
  },
  orderDate: {
    fontFamily: "roboto-regular",
    color: "#121212",
    marginTop: 1,
    marginLeft: 341,
  },
  cartDetailsContainer: {
    width: 400,
    height: 203,
  },
  cartDetailsOrderLabel: {
    fontFamily: "roboto-regular",
    color: "#121212",
    fontSize: 15,
  },
  editIcon: {
    color: "rgba(0,0,0,1)",
    fontSize: 30,
    marginLeft: 370,
  },
  cartDetails: {
    fontFamily: "roboto-regular",
    color: "#121212",
    fontSize: 15,
    width: 394,
    height: 169,
    marginTop: 34,
    marginLeft: 6,
  },
  bottomBtnRow: {
    width: 277,
    height: 42,
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
  },
  cancelBtn: {
    width: 128,
    height: 42,
    backgroundColor: "#ff0000",
    borderRadius: 10,
    alignItems: "center",
    justifyContent: "center",
  },
  cancelOrder: {
    fontFamily: "roboto-700",
    color: "rgba(255,255,255,1)",
    fontSize: 15,
  },
  completeBtn: {
    width: 128,
    height: 42,
    backgroundColor: "#03c551",
    borderRadius: 10,
    alignItems: "center",
    justifyContent: "center",
  },
  completeOrder: {
    fontFamily: "roboto-700",
    color: "rgba(255,255,255,1)",
    fontSize: 15,
  },
});

export default PendingOrderShowDetails;
